import React from 'react';
import App from 'next/app';
import Head from "next/head";
import "../style.css";


class MyApp extends App {
    render() {
        const { Component, pageProps } = this.props;
        return (
            <>
                <Head>
                    <title>Slider</title>
                </Head>
                <div class="container ">
                    <div class="bg-gray-400">
                        <Component {...pageProps} />
                    </div>
                </div>
            </>
        )
    }
}

export default MyApp
